from lxml import html
import requests



def get_first_name(fullname):
    firstname = ''
    try:
        firstname = fullname.split()[0]
    except Exception as e:
        print(str(e))
    return firstname

def get_last_name(fullname):
    lastname = ''
    try:
        index=0
        for part in fullname.split():
            if index > 0:
                if index > 1:
                    lastname += ' '
                lastname +=  part
            index += 1
    except Exception as e:
        print(str(e))
    return lastname

def replace_characters(name):
    return name.replace(' ', "-").replace("ö", "oe").replace("ü", "ue").replace("ä", "ae").replace("ć", "c")\
        .replace("ß", "ss").replace("š", "s").replace("š", "s").replace("ž", "z").replace("é", "e").replace("è", "e")\
        .replace("à", "a").replace("č", "c")
